import * as React from "react";

import { makeStyles, Theme, createStyles } from "@material-ui/core/styles";
import HighlightOffIcon from "@material-ui/icons/HighlightOff";

import CircularProgress from "@material-ui/core/CircularProgress";

import { Skill } from "src/app/common/types";
import Typography from "@material-ui/core/Typography";
import ListItemText from "@material-ui/core/ListItemText";
import Grid from "@material-ui/core/Grid";

export interface HeroSkillProps {
  skill: Skill;
}

const HeroSkill: React.SFC<HeroSkillProps> = ({ skill }) => {
  console.log(skill);
  return (
    <>
      <Grid item xs={8}>
        <p>{skill.name}</p>
      </Grid>
      <Grid item xs={2}>
        {skill.damage > 0 ? (
          <CircularProgress variant="static" value={skill.damage / 2} />
        ) : (
          <HighlightOffIcon></HighlightOffIcon>
        )}
      </Grid>
      <Grid item xs={2}>
        <p>{skill.damage}</p>
      </Grid>
    </>
  );
};

export default HeroSkill;
try {
    // @ts-ignore
    HeroSkill.displayName = "HeroSkill";
    // @ts-ignore
    HeroSkill.__docgenInfo = { "description": "", "displayName": "HeroSkill", "props": { "skill": { "defaultValue": null, "description": "", "name": "skill", "required": true, "type": { "name": "any" } } } };
    // @ts-ignore
    if (typeof STORYBOOK_REACT_CLASSES !== "undefined")
        // @ts-ignore
        STORYBOOK_REACT_CLASSES["src/app/components/HeroSkill/index.tsx#HeroSkill"] = { docgenInfo: HeroSkill.__docgenInfo, name: "HeroSkill", path: "src/app/components/HeroSkill/index.tsx#HeroSkill" };
}
catch (__react_docgen_typescript_loader_error) { }
